script: |
  super -f text -I q9660.spq | sort > q9660.out

inputs:
  - name: q9660.spq
    data: |
      SELECT DISTINCT - col1 + - col0 / col0 col0, + col1 / - + col2 col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q9660.out
    data: |
      -2	0
      -22	-2
      -82	-1
